import Rank from './components/rank/rank.js';
import Logo from './components/logo/logo.js'
import './App.css';

const particleOptions = {
  particles: {
    number: {
      value: 80,
      density: {
        enable: true,
        value_area: 1000
      }
    }
  }
}
 class App extends Component {
    constructor(){
      super();
      this.state = {
        input: " ",
      }
    }

    onInputChange = (event) =>{
      console.log(event.target.value);
    }

    onButtonSubmit = () => {
      app.mode.predict('{workflow-id}', "https://samples.clarifai.com/metro-north.jpg").then(
    function(response){
      // Do something with response
    },
    function(err){
      // There was an error
    }
);
    }

render(){
  return (
    <div className="App">
      <Particles className="particles"
        params ={particleOptions}
      />

      <Navigation />
      <Logo />
      <Rank />
    <ImageLinkForm onInputChange = {this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
    </div>
  );
}
}

export default App;
